        const styles = StyleSheet.create({
            container: {
                flex: 1,
                backgroundColor: '#fff',
                alignItems: 'center',
                justifyContent: 'center',
            },input:{
                height:'10rem',
                width:'10rem'
            }

        });
        return(
            <View>
                <TextInput style={styles.input}
                    placeholder='Indtast en ny titel tast'
                    ref={this.subTitle}
                    onChangeText={text => onChangeText(text)}
                />

                <Button  title='Lav en ny title'></Button>

            </View>


        )


    };
};
